<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Redirecting...</title>
    <style>
        body {
            margin: 0;
            height: 100vh;
            display: flex;
            justify-content: center;
            align-items: center;
            background-color: #081828;
            color: white;
            font-family: Arial, sans-serif;
            overflow: hidden;
        }

        .message-container {
            text-align: center;
            animation: fadeIn 1s ease-in-out;
        }

        .loading-text {
            font-size: 24px;
            margin: 20px 0;
            font-weight: bold;
            display: flex;
            align-items: center;
            justify-content: center;
        }

        .loading-text i {
            margin-right: 10px;
        }

        @keyframes fadeIn {
            0% {
                opacity: 0;
            }
            100% {
                opacity: 1;
            }
        }

        .spinner {
            border: 8px solid #f3f3f3;
            border-top: 8px solid #3498db;
            border-radius: 50%;
            width: 50px;
            height: 50px;
            animation: spin 2s linear infinite;
            margin: 20px auto;
        }

        @keyframes spin {
            0% {
                transform: rotate(0deg);
            }
            100% {
                transform: rotate(360deg);
            }
        }

        .click-count {
            font-size: 50px;
            font-weight: bold;
            color: #4CAF50;
			padding: 10px;
        }

        .error-message {
            color: #FF0000;
            font-size: 18px;
        }

    </style>
